        <p>{k.review}</p>
      </div>
      <div>
        <p>{k.date}</p>
      </div>
      <div>
        <img className={rev.img_stars} src={`http://localhost:3001/${k.stars}`} />
      </div>
      <div>
        if(k.filename != null) 
        {<p></p>
        } else {
 <img className={rev.img} src={`http://localhost:3001/unknown.jpg`} />
        }

      </div>
    </div>
  );
}

export default Review;
